function healthandcare_admin_change_post_type(a){var d=jQuery(a).parent().next().find("label");d.append('<span class="sc_refresh iconadmin-spin3 animate-spin"></span>');var c=jQuery(a).val();var b={action:"healthandcare_admin_change_post_type",nonce:HEALTHANDCARE_GLOBALS.ajax_nonce,post_type:c};jQuery.post(HEALTHANDCARE_GLOBALS.ajax_url,b,function(f){var k=JSON.parse(f);if(k.error===""){var j=jQuery(a).parent().next().find("select");var h=j.find("option").eq(0);var e='<option value="'+h.val()+'">'+h.html()+"</option>";for(var g in k.data.ids){e+='<option value="'+k.data.ids[g]+'">'+k.data.titles[g]+"</option>"}j.html(e);d.find("span").remove()}});return false};